Description:
Make your gun flip using it's recoil and fly as far as you can!

How to play this infinite gun flipping game:
— Upgrade your favorite weapon;
— Unlock awesome skin for it;
— Hit play button;
— Shoot at the right moment to keep moving up!
— Pick up useful bonuses (ammo and boosters)!
— Go as far as you can!
— Collect coins to unlock new guns and skins!

It's easy! Tap, shoot and then flip your gun! Be the best shooter!
